import Link from "next/link";

const Menu = () => {
  return (
    <nav>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>About</a>
      </Link>
      <Link href="/design">
        <a>Design</a>
      </Link>
      <style jsx>{`
        nav {
          font-family: "Raleway";
          display: flex;
          flex-direction: column;
          width: auto;
          height: 100%;
          background-color: #2e2e2e;
        }

        a {
          padding: 0.5rem;
          font-size: 1rem;
          transition: 0.35s;
        }

        @media only screen and (max-width: 1024px) {
          a {
            padding: 1.5rem 0.5rem;
            margin: 0.125rem 0.25rem;
          }
        }

        a:hover {
          color: #2e2e2e;
          text-decoration: none;
          transition: 0.35s;
        }
      `}</style>
    </nav>
  );
};

export default Menu;
